  backgroundColor:'green',
  height:'100vh',
  width:'100%',
  display:'grid',
  alignItems:'center',
  justifyContent:'center'
}
const heading={
  backgroundColor:'white',
  borderRadius:'50%',
  padding:'20px'
}
let date= new Date();
let hr = date.

ReactDOM.render(
  <>
    <div style={greeting}>
      <h1 style={heading}>Hello friend</h1>
    </div>
  </>
  ,
  document.getElementById("root"));
